import { React } from "react";

import EventList from "./Events/EventsList";
import NavBar from "./NavBar/NavBar";

const Home = ({ location }) => {
  var showDonateState = false;
  if (location.state.showDonate) {
    showDonateState = location.state.showDonateState;
  }

  return (
    <div>
      <NavBar />
      <EventList showDonate={showDonateState} />
    </div>
  );
};

export default Home;
